import S from "./PopUpTitleWithSlowUnderline.module.css"
export const PopUpTitleWithSlowUnderline = ({title}) => {
    return (
        <>
        <p className={S.title}>{title}</p>
        <div className={S.divider}>/</div>
        </>
    )
}
